import React from 'react';

const SignIn = (props) => {
    const { username, password } = props;
    return (
        <div className="SignInForm">
            <form>
                <label>Username
                <input
                    name='username'
                    type='text'
                    value={username}

                />
                </label>

                <label>Password
                <input
                name='password'
                type='password'
                value={password}></input>
                </label>

            </form>
        </div>
    )
}

export default SignIn;
